import React from 'react'

export default function Board() {
    const BoardDiv = {
        height: '600px',
        width: '600px',
        backgroundColor: 'white',
        border: '1px solid red',
        margin: '100px'
    }

    return (
        <div style={BoardDiv}>

        </div>
    )
}
